import { Component } from '@angular/core';

@Component({
  selector: 'app-create-userstory',
  templateUrl: './create-userstory.component.html',
  styleUrls: ['./create-userstory.component.css']
})
export class CreateUserstoryComponent {
  epic: Epic = new Epic();
  constructor(private epicService: EpicService,
    private router: Router){}

  ngOnInit(): void {

  }

  saveEpic(){
    this.epicService.createEpic(this.epic).subscribe(data =>{
      console.log(data);
      this.goToEpicList();
    },
    error => console.log(error));
  } 

  goToEpicList(){
    this.router.navigate(['/epics']);
  }

  onSubmit(){
    console.log(this.epic);
    this.saveEpic();
  }
}
